const Welcome = () => {
  return (
    <div className="p-8 mb-8 border border-gray-200 rounded-lg bg-gray-50 dark:bg-gray-800 dark:border-gray-700 md:p-12">
      <h1 className="mb-4 text-4xl font-extrabold leading-none tracking-tight text-gray-900 md:text-5xl lg:text-6xl dark:text-white">
        Images Gallery
      </h1>
      <p className="mb-6 text-lg font-normal text-gray-500 dark:text-gray-400">
        This is a simple application that retrieves photos using Unsplash api.
        In order to start enter any search term in the input field.
      </p>
      <button
        className="px-4 py-6 text-lg font-normal text-white bg-blue-600 rounded-lg"
        variant="primary"
        href="https://unsplash.com"
        target="_blank"
      >
        Learn more
      </button>
    </div>
  );
};

export default Welcome;
